script: |
  super -f text -I q7546.spq | sort > q7546.out

inputs:
  - name: q7546.spq
    data: |
      SELECT + + col2 + + col2 AS col0, col0 FROM tab2 (FORMAT parquet) cor0 WHERE NOT ( ( - - 74 / + - col0 ) BETWEEN - col0 * + col0 AND NULL );
  - name: tab2

outputs:
  - name: q7546.out
    data: |
